import { Container, Button } from 'reactstrap';


import HomePageCarousel from '../components/HomePage/HomePageCarousel';
import logo from '../assets/logo/cheese-logo.png';

function Home() {
    return (
        <Container>
            <div className="row justify-content-center">
                <div className="col-auto d-flex align-items-center">
                    <h1 className="mb-0">PZ Cheeseria</h1>
                    <img src={logo} alt="logo" className="rounded ms-3" width="100" height="100" />
                </div>
            </div>

            <h4 className='text-center'>Delicious, hand-crafted cheeses delivered to your door.</h4>
            <div>
                <HomePageCarousel />
            </div>
        </Container>
    );
}

export default Home;
